import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom'

import SingIn from '../pages/SingIn'


function Routes (){
  return(
    <BrowserRouter>
      <Switch>
        <Route path="/" component={SingIn} />

      </Switch>
    </BrowserRouter>
  )
}

export default Routes;
